import React, {Component} from 'react';

class Pricing extends Component {
    state = {
        prices: [100, 150, 250],
        positions: ['Balcony', 'Medium', 'Star'],
        desc: ['Lorem ipsum dolor sit amet, consectetur adipisicing elit. Ea et, id minus optio quaerat sit.',
            'Lorem ipsum dolor sit amet, consectetur adipisicing elit. Ea et, id minus optio quaerat sit.',
            'Lorem ipsum dolor sit amet, consectetur adipisicing elit. Ea et, id minus optio quaerat sit.'
        ],
        linkTo: [
            'http://google.com',
            'http://google.com',
            'http://google.com',
        ]
    }
    showBoxes = () => (
        this.state.prices.map((box, i) => (
            <div className="pricing_item">
                <div className="pricing_inner_wrapper">
                    <div className="pricing_title">
                        <span>${this.state.prices[i]}</span>
                    </div>
                    <div className="pricing_description">Description</div>
                    <div className="pricing_buttons">Button</div>
                </div>
            </div>
        ))
    )

    render() {
        return (
            <div className="bck_black">
                <div className="center_wrapper pricing_section">
                    <h2>PRICING</h2>
                    <div className="pricing_wrapper">
                        {this.showBoxes()}
                    </div>
                </div>

            </div>
        );
    }
}

export default Pricing;
